import React from "react";
import { Formik, Form, Field } from "formik";
import { TextField, InputLabel, Box } from "@mui/material";
import styles from "./index.module.css";
const SabhasadregistrationForm = () => {
  const handleSubmit = (values) => {
    // Handle form submission here

    console.log(values);
  };

  return (
    <Formik
      initialValues={{
        MemberNo: "",
        name: "",
        TypeofMember: "",
        Typeoffarmer: "",
        NameofFatherHusband: "",
        Surname: "",
        NameInEnglish: "",
        NameofFatherHusbandInEnglish: "",
        SurnameInEnglish: "",
        Mainly: "",
        birthdate: "",
        Age: "",
        ResolutionNo: "",
        DateofResolution: "",
        status: "",
        SelectFarmerStatus: "",
        Address1: "",
        Address2: "",
        village: "",
        pin: "",
        Taluk: "",
        State: "",
        country: "",
        phoneNo: "",
        Mobileno: "",
        Gender: "",
        caste: "",
        SubCaste: "",
        casteclass: "",
        study: "",
        profession: "",
        MaritalStatus: "",
        RationCardNo: "",
        ElectionCardNo: "",
        AadhaarCardNo: "",
        PANCardNo: "",
        email: "",
        SavingsAccountNo: "",
        KCCCardNo: "",
        CardIssueDate: "",
      }}
      onSubmit={handleSubmit}
    >
      <Form>
      <Box
      sx={{
        display: 'grid',
        gridTemplateColumns: { sm: '1fr 1fr 1fr' },
        gap: 2,
      }}
    >
        <InputLabel className={styles.label}>Member No</InputLabel>
        <Field
          name="memberNo"
          as={TextField}
          fullWidth
          sx={{ height: "20px" }}

        />
        </Box>
      </Form>
    </Formik>
  );
};

export default SabhasadregistrationForm;
